import React, { Component, Fragment, useState } from 'react';
import Board from './board'
import PrimarySearchAppBar from './myAppBar'
import { Button } from '@material-ui/core'


function Ui(props) {
    const [rolls] = useState(state.rolls);
    console.log('children rolls ', rolls);

  return (  

        <Fragment>
          <PrimarySearchAppBar />
            {(rolls.length > 0 && typeof(rolls)!== 'undefined' ) ?
              <Board
                rolls={rolls}
                rowsNum={props.state.rowsNum}
                colsNum={props.state.colsNum}
              />
              : <div></div>}

        </Fragment>
  )
}

export default Ui
